$((()=>{utilityClearFlashModalOnHide(),utilityOpenFlashModal(),utilitySetCopyRightYear()}));const utilityOpenFlashModal=()=>{if($("#flashModalBody").children().length>0){new bootstrap.Modal(document.getElementById("flashModal")).show()}},utilityClearFlashModalOnHide=()=>{document.getElementById("flashModal").addEventListener("hidden.bs.modal",(t=>{$("#flashModalBody").empty()}))},utilitySetCopyRightYear=()=>{const t=new Date;$(".copy-right-year").text(t.getFullYear())};